import React from 'react';
import UsersOnline from './UsersOnline';
import styled from '@emotion/styled';

const Wrapper = styled.div`
display:flex;
justify-content: center;
align-items: center;
height: 50vh;
grid-row: 3;
`
const Info = () => {
    return(
        <>
        <UsersOnline />
        </>
    )
}

export default UsersOnline;
